    const [ modalState, setModalState ] = useState("modalCompleteOff");

    const [ menuData, setMenuData ] = useState([
        {
            "studentId":"1",
            "name":"teste0"
        },
        {
            "student_id":"2",
            "name":"teste2"
        },
        {
            "studentId":"3",
            "name":"teste3"
        },
        {
            "studentId":"4",
            "name":"teste4"
        },
        {
            "studentId":"5",
            "name":"teste5"
        },
        {
            "studentId":"6",
            "name":"teste6"
        },
        {
            "studentId":"7",
            "name":"teste7"
        },
        {
            "studentId":"8",
            "name":"teste8"
        },
        {
            "studentId":"9",
            "name":"teste9"
        },
    ]);

    return (
        <ModalStateContext.Provider value={{modalState, setModalState, menuData, setMenuData}}>
            {props.children}
        </ModalStateContext.Provider>
    );
}
